import React, { useRef } from 'react'
import './style.css'

function Task({props,dlt}){
    const ref=useRef('') 
    const done=()=>{
       ref.current.classList.add('rsi')
    }
  
    return(
       <div>
        <input type="text" className={`list ${todo.completed}`} name="" id="inp" value={props} ref={ref} disabled readOnly/>
        <input type="button" onClick={dlt} value="Supprimer" className='btn-danger'/>
        <input type="button" value="Done" id="do" onClick={done} className='btn-info'/>
       </div>
    )
}
export default Task
